'''
Given: A DNA string t having length at most 1000 nt.

Return: The transcribed RNA string of t


Sample Dataset
GATGGAACTTGACTACGTAAATT

Sample Output
GAUGGAACUUGACUACGUAAAUU

'''

t = ""

u = ""

for nucleotide in t:
    if nucleotide == "T":
        u += 'U'
    else:
        u += nucleotide
    
print(u)